import React from "react";
import { Link } from "react-router-dom"

export default function DeckCreateButton(){
  return (
    <div className="mb-2">
      <Link to="/decks/new">
        <div className="btn btn-secondary d-flex flex-row">
          <i className="fas fa-plus mr-2"></i>
          <p className="lead">Create Deck</p>
        </div>
      </Link>
    </div>
  )
}
